import ModalFooter from "./ModalFooter";
import ModalHeader from "./ModalHeader";

function Modal(props) {
	return (
		<div className="modal" tabIndex={-1}>
			<div className="modal-dialog">
				<div className="modal-content">
					<ModalHeader />
					<ModalBody />
					<ModalFooter />
				</div>
			</div>
		</div>
	);
}
export default Modal;
